import { useNavigate } from "react-router-dom";

const Home = () =>{

    const navigate = useNavigate();


    let joinRoomAff = async() =>{
        let response = await fetch('http://127.0.0.1:8000/api/join',{
          method: "PUT",
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify({"side" : "aff"})

        })
        let data = await response.json()
        console.log(data)
        navigate("rooms/" + data)
    }
    let joinRoomNeg = async() =>{
        let response = await fetch('http://127.0.0.1:8000/api/join',{
            method: "PUT",
            headers: {
            'Content-Type': 'application/json'
            },
            body: JSON.stringify({"side" : "neg"})
        })
        let data = await response.json()
        console.log(data)
        navigate("rooms/" + data)

    }


    return (
        <div className="App">
            <br/>
            <br/>
            <button onClick={joinRoomAff}>AFFIRMATIVE</button>
            <button onClick={joinRoomNeg}>NEGATIVE</button><br/><br/><br/>




        </div>
    );
}

export default Home;
